import static org.junit.Assert.*;

import org.junit.Test;


public class Solution2Test {

	Solution2 s = new Solution2();
	
	@Test
	public void test1() {
		assertFalse(s.isMatch("aa", "a"));
		assertTrue(s.isMatch("aa", "aa"));
		assertFalse(s.isMatch("aaa","aa"));
		assertTrue(s.isMatch("aa", "*"));
		assertTrue(s.isMatch("aa", "a*"));
		assertTrue(s.isMatch("ab", "?*"));
		assertFalse(s.isMatch("aab", "c*a*b"));
		assertTrue(s.isMatch("", "*"));
	}
	
	@Test
	public void test2() {
		String ss = "";
		String ps = "**";
		assertFalse(s.isMatch(ss, ps));
	}
	
	@Test
	public void test3() {
		assertTrue(s.isMatch("hi", "*?"));
	}
	
	@Test
	public void test4() {
		assertFalse(s.isMatch("ab", "*a"));
	}
	
	@Test
	public void test5() {
		assertTrue(s.isMatch("aac", "*ac"));
	}
}
